select(2, ...).LoadData("APP_INFO","Global",[[return {version=405,lastSync=1602779622,message={id=0,msg=""},news={{title="TradeSkillMaster v4.10.9 Changelog",content="TSM v4.10.9 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Added workaround for AH bugs in 9.0.1<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1602636041,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-9-changelog/"},{title="TradeSkillMaster v4.10.8 Changelog",content="TSM v4.10.8 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Initial support for patch 9.0.1<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1602630062,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-8-changelog/"},{title="TradeSkillMaster v4.10.7 Changelog",content="TSM v4.10.7 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Various performance improvements when using NumInventory / SmartAvgBuy sources<br />* Fixed error when viewing Crafting UI<br />* Fixed error from account syncing<br />* Fixed player gold tooltip error<br />* Fixed error when Destroying while posting items via Browse<br />* [Retail] Re-added support for using Auctionator prices<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1601850508,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-7-changelog/"},{title="Introducing: TSM Ledger!",content="It's been possible to export your TSM Accounting data through the Desktop Application for quite some time, usually to manipulate and analyse in your favourite spreadsheeting software. To do this in the past meant maintaining several documents, and trying to figure out how to manually build formulae to interpret the vast amount of data available. [...]",timestamp=1600796173,link="https://blog.tradeskillmaster.com/introducing-tsm-ledger/"},{title="TradeSkillMaster v4.10.6 Changelog",content="TSM v4.10.6 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Added apperance option to show total gold instead of player gold at the top of TSM windows<br />* Fixed some disenchanting ratios<br />* Fixed issue with Bank UI not updating the group tree when switching tabs<br />* [Retail] Fixed issues when the reagent bank hasn't been purchased<br />* [Classic] Fixed issue with Vendoring buying not buying the correct amount<br />* [Classic] Fixed issue with Sniper not finding auctions under 1c per item<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1600645901,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-6-changelog/"},{title="TradeSkillMaster v4.10.5 Changelog",content="TSM v4.10.5 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed error when importing groups with operations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1600103433,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-5-changelog/"}}}]]) --<APP_INFO,Global,1602779622>
